import React from 'react';
import styled, {css} from 'styled-components';
import Project from "./Project";

const Wrapper = styled.section`
    align-item: start; 
    margin: 5% 0 5% 0;
    padding 0 5% 2% 5%;
`;
const Underline = styled.section`
    border-bottom-color: #cbcbcb;
    border-bottom-width: 1px;
    border-bottom-style: solid;
`;
function getComponent(element){
    if(element.section_title){
        return <Title title={element.section_title} />
    }
}

const UnderLineSection = (props) =>(
<div>
    <Wrapper>
        <Underline>

            {props.data.map((o, index)=>{
                return <p>{o.section_title}</p>
            })}
        </Underline>
    </Wrapper>
    </div>
)

export default UnderLineSection;
